import React from 'react';
import styled from 'styled-components';
import { COLORS } from '../styles/colors';

// Easily changeable hero content
const HERO_HEADING = 'Custom AI';
const HERO_SUBTITLE = 'We build tailored AI solutions for your business.';
const HERO_BUTTON = 'Get Started';
const HERO_IMAGE_ALT = 'Custom AI Illustration';

const HeroSection = styled.section`
  display: flex;
  align-items: center;
  justify-content: center;
  min-height: 60vh;
  padding: 4rem 0 2.5rem 0;
  background: #fafbfa;
  @media (max-width: 900px) {
    flex-direction: column;
    padding: 2.5rem 0 1.5rem 0;
    min-height: 0;
  }
`;

const HeroLeft = styled.div`
  flex: 1.2;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: center;
  min-width: 0;
  padding-left: 2.5vw;
  @media (max-width: 900px) {
    padding-left: 0;
    align-items: center;
    text-align: center;
  }
`;

const HeroHeading = styled.h1`
  font-size: 2.7rem;
  font-weight: 700;
  color: #222;
  margin: 0 0 1.1rem 0;
  line-height: 1.08;
  letter-spacing: -0.01em;
  font-family: 'Inter', 'system-ui', 'Arial', sans-serif;
  @media (max-width: 700px) {
    font-size: 2rem;
  }
`;

const HeroSubtitle = styled.p`
  font-size: 1.25rem;
  color: #555;
  margin: 0 0 2.1rem 0;
  font-weight: 400;
  max-width: 420px;
  @media (max-width: 700px) {
    font-size: 1.05rem;
    margin-bottom: 1.3rem;
  }
`;

const HeroButton = styled.a`
  background: #222;
  color: #fff;
  font-size: 1.15rem;
  font-weight: 600;
  border: none;
  border-radius: 8px;
  padding: 1.1rem 2.1rem;
  text-decoration: none;
  cursor: pointer;
  display: inline-block;
  box-shadow: 0 2px 8px rgba(24,75,84,0.04);
  transition: background 0.18s;
  &:hover {
    background: #184B54;
  }
`;

const HeroRight = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: center;
  min-width: 0;
  @media (max-width: 900px) {
    margin-top: 2.2rem;
    width: 100%;
  }
`;

const HeroImage = styled.div`
  width: 340px;
  height: 420px;
  background: #eee;
  border-radius: 18px;
  box-shadow: 0 2px 16px rgba(24,75,84,0.06);
  display: flex;
  align-items: center;
  justify-content: center;
  color: #bbb;
  font-size: 1.2rem;
  font-weight: 500;
  @media (max-width: 700px) {
    width: 90vw;
    max-width: 340px;
    height: 260px;
  }
`;

const CustomAI = () => (
  <main>
    <HeroSection>
      <HeroLeft>
        <HeroHeading>{HERO_HEADING}</HeroHeading>
        <HeroSubtitle>{HERO_SUBTITLE}</HeroSubtitle>
        <HeroButton href="mailto:hello@example.com">{HERO_BUTTON}</HeroButton>
      </HeroLeft>
      <HeroRight>
        <HeroImage aria-label={HERO_IMAGE_ALT}>[image]</HeroImage>
      </HeroRight>
    </HeroSection>
    {/* Add more page content here */}
  </main>
);

export default CustomAI;
